import React from 'react';
import Logo from '../assets/demologo.jpg';

function Navbar() {
  return (
    <div className="navabr">
        <div className="leftSide">
            <img scr={Logo} alt="GoKu" />
        </div>
        <div className="rightSide"></div>
    </div>
  );
}

export default Navbar
